INSERT INTO `cc_content` VALUES (4,'下单须知','<p>\r\n	<figure class=\"easyimage easyimage-full\">\r\n	<p>\r\n		<img alt=\"\" src=\"blob:http://logistics.localhost/dea28938-b2aa-4bc8-9bf6-70fb0f4b52bf\" style=\"width:800px\" /><span font-size:=\"\" microsoft=\"\" style=\"color: rgb(0, 0, 0); font-family: \">在使用blinghour闪亮时刻海淘（以下亦简称&ldquo;blinghour&rdquo;、&ldquo;闪亮时刻&rdquo;或&ldquo;我们&rdquo;）的直运内地代下单服务前，请务必仔细阅读并理解本协议及免责声明。如果用户不接受本协议及免责声明，可立即停止使用直运内地下单服务。如果使用直运内地代下单服务，则视为对blinghour本协议和免责声明全部内容的接受。</span></p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		blinghour有权不定期修改现有协议及免责声明或指定新的协议及免责声明，并在blinghour网站及App上公布，而不再单独通知您。任何修改或新版本的协议及免责声明一经公布立即生效。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		特别提示：本协议及免责声明内容中以黑体、加粗、下划线、斜体、红字等方式显著标识的条款，请用户着重阅读。</p>\r\n	<h3 microsoft=\"\" style=\"padding: 30px 0px 0px; margin: 0px 0px 8px; font-size: 13px; border-top: 1px solid rgb(224, 224, 224); position: relative; color: rgb(0, 0, 0); font-family: \">\r\n		此份协议及免责声明将向您解释：</h3>\r\n	<ul class=\"info_nav\" font-size:=\"\" microsoft=\"\" style=\"padding: 0px 0px 0px 24px; margin: 0px 0px 20px; line-height: 35px; color: rgb(0, 0, 0); font-family: \">\r\n		<li style=\"padding: 0px; margin: 0px; list-style: disc;\">\r\n			<a href=\"http://www.blinghour.com/protocol.html#A\" style=\"padding: 0px; margin: 0px; color: rgb(102, 102, 102); text-decoration-line: none;\">1、直运内地代下单的定义及流程</a></li>\r\n		<li style=\"padding: 0px; margin: 0px; list-style: disc;\">\r\n			<a href=\"http://www.blinghour.com/protocol.html#B\" style=\"padding: 0px; margin: 0px; color: rgb(102, 102, 102); text-decoration-line: none;\">2、直运内地代下单的订单费用构成</a></li>\r\n		<li style=\"padding: 0px; margin: 0px; list-style: disc;\">\r\n			<a href=\"http://www.blinghour.com/protocol.html#C\" style=\"padding: 0px; margin: 0px; color: rgb(102, 102, 102); text-decoration-line: none;\">3、直运内地代下单的差额退款/差额补款</a></li>\r\n		<li style=\"padding: 0px; margin: 0px; list-style: disc;\">\r\n			<a href=\"http://www.blinghour.com/protocol.html#D\" style=\"padding: 0px; margin: 0px; color: rgb(102, 102, 102); text-decoration-line: none;\">4、直运内地代下单的订单取消</a></li>\r\n		<li style=\"padding: 0px; margin: 0px; list-style: disc;\">\r\n			<a href=\"http://www.blinghour.com/protocol.html#E\" style=\"padding: 0px; margin: 0px; color: rgb(102, 102, 102); text-decoration-line: none;\">5、blinghour终止直运内地代下单服务的情形及免责声明</a></li>\r\n		<li style=\"padding: 0px; margin: 0px; list-style: disc;\">\r\n			<a href=\"http://www.blinghour.com/protocol.html#F\" style=\"padding: 0px; margin: 0px; color: rgb(102, 102, 102); text-decoration-line: none;\">6、退换货等售后事宜</a></li>\r\n		<li style=\"padding: 0px; margin: 0px; list-style: disc;\">\r\n			<a href=\"http://www.blinghour.com/protocol.html#G\" style=\"padding: 0px; margin: 0px; color: rgb(102, 102, 102); text-decoration-line: none;\">7、进口税费缴纳及海关相关规定</a></li>\r\n		<li style=\"padding: 0px; margin: 0px; list-style: disc;\">\r\n			<a href=\"http://www.blinghour.com/protocol.html#H\" style=\"padding: 0px; margin: 0px; color: rgb(102, 102, 102); text-decoration-line: none;\">8、使用法律及争议解决</a></li>\r\n	</ul>\r\n	<h3 class=\"fs15\" microsoft=\"\" style=\"padding: 30px 0px 0px; margin: 0px 0px 8px; font-size: 15px; border-top: 1px solid rgb(224, 224, 224); position: relative; color: rgb(0, 0, 0); font-family: \">\r\n		1、直运内地代下单的定义及流程</h3>\r\n	<h4 microsoft=\"\" style=\"padding: 0px; margin: 0px; font-size: 13px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		1-1 直运内地代下单的定义</h4>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		blinghour提供的&ldquo;代下单&rdquo;服务，不同于&ldquo;代购&rdquo;。&ldquo;代下单&rdquo;指用户选定商品后，blinghour代用户在海外电商下单，并通过第三方送至用户指定的收货地址。因此，blinghour自身既不销售、经手商品，也不承运商品。<b style=\"padding: 0px; margin: 0px;\">&ldquo;代下单&rdquo;服务仅是为了提升用户在海淘方面的体验，blinghour提供的一项基于导购服务延伸的增值服务。在使用&ldquo;代下单&ldquo;服务时，与用户形成买卖关系的对象为商品来源的海外电商。</b></p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		本协议及免责声明所称&ldquo;直运内地代下单&rdquo;服务，是指blinghour接受用户委托，在海外电商上提交海外订单，海外电商将商品直接发给用户在委托订单上预留的内地地址的代下单服务。&nbsp;</p>\r\n	<h4 microsoft=\"\" style=\"padding: 0px; margin: 0px; font-size: 13px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		1-2直运内地代下单流程</h4>\r\n	<h4 class=\"small_h4\" microsoft=\"\" style=\"padding: 0px; margin: 0px; font-size: 13px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第一步：用户在blinghour上浏览和选择商品。</h4>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		blinghour的技术团队以及运营团队每日会及时同步和更新海外电商各类数据和信息，包括但不仅限于库存、商品描述、商品价格、促销活动等。由于海外电商自身的数据有可能出现差错或技术接口出现不同步的情况，我们无法保证您100%能以blinghour上显示的价格或库存买到对应的商品。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		blinghour上的商品信息，均通过计算机软件系统自动获取，未经人工干预。如所抓取的海外电商网站原始信息错误，且足以导致用户产生错误认识并作出错误判断的，用户应自行向海外电商主张权利，blinghour不承担责任。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		blinghour所提供的商品介绍（包括尺码等）、对外文的翻译等参考信息，仅供用户初步了解商品之用，用户应有能力独立分析、作出判断，并将自行承担相应的后果。</p>\r\n	<h4 class=\"small_h4\" microsoft=\"\" style=\"padding: 0px; margin: 0px; font-size: 13px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第二步：提交并支付您的委托订单</h4>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		您可以通过微信、支付宝、网银等方式，以人民币作为结算货币向blinghour支付您的委托订单代下单款项。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		<b style=\"padding: 0px; margin: 0px;\">blinghour不赚取汇率差。</b>人民币折算价格的比率为当日招商银行现汇卖出价汇率再加上0.6%第三方支付平台收取的交易手续费。需要提请注意的是，第三方支付平台指微信（财付通）、支付宝、网银等。通常的流程是，用户通过第三方支付平台向blinghour支付代下单款，第三方支付平台通常将先行扣除交易价款0.6%左右的交易手续费，再将剩余款项转付给blinghour。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		&nbsp;比如，若您购买的某件商品需要支付给海外电商1000美元，当日招商银行的美元现汇卖出价汇率为6.7。您代下单时需要支付给blinghour的代下单款项为1000*6.7*（1+0.6%）=6740.20元人民币。订单金额0.6%折合的40.20元人民币为第三方支付平台收取的交易手续费。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		您无需担心您支付账户的安全。blinghour的所有支付均在第三方交易平台上完成，并不存储或获取您支付账户的所有涉及到支付安全的任何信息。</p>\r\n	<h4 class=\"small_h4\" microsoft=\"\" style=\"padding: 0px; margin: 0px; font-size: 13px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第三步：blinghour成功代您在海外电商下单，移交订单截图。</h4>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		<b style=\"padding: 0px; margin: 0px;\">国家法定工作时间内，blinghour通常会在收到并确认您支付的款项后1个小时内完成代下单。节假日周末或非工作时间段最晚8小时内完成代下单。若遇库存紧张或限时促销活动，欢迎您使用电话客服或微博客服进行催单。</b></p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		成功代下单后，我们会向您的blinghour账户移交代下单的海外电商订单截图，您可以在订单详情中查看。若因海外电商超卖、售罄、价格浮动等原因未能成功代下单或有差额退款，工作日时间内我们最晚不超过12小时将您的退款原路退回您的支付账户，节假日或周末可能出现一定的延误。支付宝、微信（财付通）、网银等第三方支付平台退款到账时间不在我们控制范围内，到账时间可能会出现1-3个工作日的延误。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		通常情况下，blinghour会为用户在海外电商注册专属账户进行代下单，以便于此后将代您注册的海外电商账户和密码向您移交。<span style=\"padding: 0px; margin: 0px; text-decoration-line: underline;\">对于少数对海外会员账号的支付及地址有特别限制的海外电商，blinghour将使用&ldquo;共用会员账号&rdquo;为用户下单，针对此类电商的委托订单发货后无法移交账号，但仍然会提供订单截图及物流跟踪信息。</span></p>\r\n	<h4 class=\"small_h4\" microsoft=\"\" style=\"padding: 0px; margin: 0px; font-size: 13px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第四步：海外电商发货，向您Email移交海外电商代注册账户</h4>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		blinghour会在工作日期间，每日至少一次查询已成功代下单但海外电商未发货的委托订单状态。若遇周末或节假日，查询时间将顺延到接下来的一个工作日。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \" text-decoration-line:=\"\">\r\n		确认海外电商发货后，blinghour会将代您在海外电商注册的账户和密码Email移交给您。您可以通过您的blinghour账户或代注册的海外电商账户进一步确认订单详情和查看物流轨迹。但请注意，私密折扣订单、拼单订单及部分在商品详情页标注使用共用账户下单的商品（少数电商对新建账户有购买限制，新建账户购买会导致下单失败），由于涉及其他用户信息及支付信息，不移交代下单账户和密码。但是，您仍然可以通过我们的委托订单详情查看相关订单截图及物流轨迹。</p>\r\n	<h4 class=\"small_h4\" microsoft=\"\" style=\"padding: 0px; margin: 0px; font-size: 13px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第五步：商品送达中国口岸，海关清关</h4>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		不同海外电商售往中国的定价模式、清关方式存在较大差异。通常有以下三种情形：</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第一种情形：标注为&ldquo;到付关税&rdquo;的商品，您需要根据DHL、UPS等国际快递要求提交身份证照片等资料进行清关，进口税费在国际快递派送时交给国际快递。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第二种情形：标注为&ldquo;关税抽检&rdquo;的商品，若被海关抽中，您需要根据海关或EMS等国内快递要求办理清关并交纳关税等进口税费。若未被抽中，您将直接收到商品，无需办理清关以及缴纳关税等进口税费。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第三种情形：标注为&ldquo;预付关税&rdquo;或&ldquo;价格中已含关税&rdquo;的商品，则表明关税等进口税费海外电商已经缴纳，您无需缴纳关税等进口税费。</p>\r\n	<h4 class=\"small_h4\" microsoft=\"\" style=\"padding: 0px; margin: 0px; font-size: 13px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第六步、用户签收商品，直运内地代下单服务结束。</h4>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		为保证您的权益，建议签收商品时与承运物流公司进行当面开箱验货后签收。</p>\r\n	<h3 class=\"fs15\" microsoft=\"\" style=\"padding: 30px 0px 0px; margin: 0px 0px 8px; font-size: 15px; border-top: 1px solid rgb(224, 224, 224); position: relative; color: rgb(0, 0, 0); font-family: \">\r\n		2、直运内地代下单的订单费用构成</h3>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		直运内地的委托订单收取的费用通常由三部分构成：</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第一部分：代用户向海外电商支付的实际商品价格；</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第二部分：代用户向海外电商支付的海外至内地的运费；</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第三部分：代下单服务费。目前blinghour的代下单服务暂不收取任何服务费。一旦开始收费，我们会在购物车及提交订单页面予以显著提示。</p>\r\n	<h3 class=\"fs15\" microsoft=\"\" style=\"padding: 30px 0px 0px; margin: 0px 0px 8px; font-size: 15px; border-top: 1px solid rgb(224, 224, 224); position: relative; color: rgb(0, 0, 0); font-family: \">\r\n		3、直运内地代下单的差额退款/差额补款</h3>\r\n	<h4 microsoft=\"\" style=\"padding: 0px; margin: 0px; font-size: 13px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		3-1差额退款</h4>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		blinghour所提供的代下单服务不赚任何差价。因此，当用户支付的代下单款大于blinghour代下单时产生的费用时，blinghour会把多收取的代下单款项产额原路退回您的支付账户。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		通常blinghour会在12个小时内发起退款，节假日或周末可能出现一定的延误。支付宝、微信（财付通）、网银等第三方支付平台退款到账时间不在我们控制范围内，到账时间可能会出现1-3个工作日的延误。</p>\r\n	<h4 microsoft=\"\" style=\"padding: 0px; margin: 0px; font-size: 13px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		3-2差额补款</h4>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		由于海外电商商品价格浮动及与blinghour数据同步等技术方面原因，有可能出现您支付的代下单款项不足以支付委托订单的情形。对此，我们的客服将电话或邮件联系您补足差额款项后进行代下单。<span style=\"padding: 0px; margin: 0px; color: rgb(242, 94, 115);\">我们接收补款唯一支付宝账号为：pay@blinghour.com 。</span></p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		若出现需要差额补款的情形，您也拥有拒绝补款、要求取消订单退款的权利。和您确认取消订单后，通常blinghour会在12个小时内发起退款，款项将原路退回您的支付账户，节假日或周末可能会出现一定的延误。支付宝、微信（财付通）、网银等第三方支付平台退款到账时间不在我们控制范围内，到账时间可能会出现1-3个工作日的延误。</p>\r\n	<h4 microsoft=\"\" style=\"padding: 0px; margin: 0px; font-size: 13px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		3-3 blinghour不支持price match，即价格保护政策。</h4>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		&nbsp;</p>\r\n	<h3 class=\"fs15\" microsoft=\"\" style=\"padding: 30px 0px 0px; margin: 0px 0px 8px; font-size: 15px; border-top: 1px solid rgb(224, 224, 224); position: relative; color: rgb(0, 0, 0); font-family: \">\r\n		4、直运内地代下单的订单取消</h3>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		<b style=\"padding: 0px; margin: 0px;\">由于代下单服务的复杂性和特殊性，一旦支付委托订单后，用户不能以&ldquo;改变购买主意&rdquo;、&ldquo;商品选择错误&rdquo;、&ldquo;购买重复&rdquo;、&ldquo;海外电商临时降价&rdquo;等主观原因取消委托订单。</b>但是，若出现以下四种情形，订单可能会被取消，用户同样拥有取消订单并要求退款的权利：</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第一种情形：成功代下单后，海外电商超卖、价格错误、预售商品发货时间延误30天以上等非用户主观原因。您可以拒绝海外电商提供的解决方案，要求取消订单并退款</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第二种情形：成功代下单后，海外电商发货前发现商品存在瑕疵。这种情形下，海外电商通常会提供降价销售或取消订单两种解决方案，您可以根据商品瑕疵的实际情况选择任意一种解决方案。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第三种情形：海外电商发错货。用户收件后发现海外电商发错货，用户可要求取消订单。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		第四种情形：海外电商的商品有明显瑕疵。用户收件后发现所购商品存在明显瑕疵时，可自行根据海外电商的退换货政策联系海外电商要求取消订单。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		订单取消后，blinghour将在海外电商退款退至代下单支付账户后，在2个工作日内发起退款，款项将原路退回您的支付账户，节假日或周末可能会出现一定的延误。支付宝、微信（财付通）、网银等第三方支付平台退款到账时间不在我们控制范围内，到账时间可能会出现1-3个工作日的延误。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		请注意，如果您是出于主观原因取消订单或自行退货，由于支付宝、微信（财付通）、网银等第三方支付平台收款时会收取不低于千分之六的手续费，因此我们退还您的订单相关款项时，会代扣这部分手续费（具体计算方法为：您实际支付的订单全部款项乘以千分之六）。如果是海外电商砍单或缺货售罄等您的非主观原因取消订单，我们将为您补贴该部分手续费。</p>\r\n	<h3 class=\"fs15\" microsoft=\"\" style=\"padding: 30px 0px 0px; margin: 0px 0px 8px; font-size: 15px; border-top: 1px solid rgb(224, 224, 224); position: relative; color: rgb(0, 0, 0); font-family: \">\r\n		5、blinghour终止直运内地代下单服务的情形及免责声明</h3>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		能否在海外电商网站成功购物存在一定的不确定性，如果在代下单过程中，出现下述情形，blinghour有权单方面终止代下单服务，并不承担任何责任。包括但不限于：</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		海外电商不能正常运行、代下单时海外电商网站的货物已售罄、海外电商网站拒绝交易、海外电商网站交易政策调整（包括商品不再直接售往内地地址、税费和运费调整等）、海外电商价格调整、海外电商优惠政策到期、银行卡交易系统故障或付款故障、中国海关规定调整等因素。或因营业时间、时差、网络速度、审核与确认流程、等待款项到账等非blinghour的原因导致无法完成代下单服务，以及非blinghour故意导致无法完成代下单服务的。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		终止代下单服务后，blinghour工作时间内将在12小时内将发起退款，款项将原路退回您的支付账户，节假日或周末可能会出现一定的延误。支付宝、微信（财付通）、网银等第三方支付平台退款到账时间不在我们控制范围内，到账时间可能会出现1-3个工作日的延误。</p>\r\n	<h3 class=\"fs15\" microsoft=\"\" style=\"padding: 30px 0px 0px; margin: 0px 0px 8px; font-size: 15px; border-top: 1px solid rgb(224, 224, 224); position: relative; color: rgb(0, 0, 0); font-family: \">\r\n		6、退换货等售后事宜</h3>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		<b style=\"padding: 0px; margin: 0px;\">由于海淘的特殊性以及代下单服务的法律关系，退换货事宜须由用户直接联系海外电商解决，blinghour无法提供退换货服务及其相关事宜。</b>用户应自行负责购买商品的售后事宜并自担费用，包括向海外电商提出退换货、价格保护、维修申请等。<b style=\"padding: 0px; margin: 0px;\">本着为用户提供良好的服务体验的原则，blinghour可在能力范围内协助用户与海外电商之间沟通，但blinghour对沟通结果不承担责任。</b></p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		请注意，根据我们的经验，海外电商直运内地的订单退换货一般要求保留完整的包装、标签及防盗扣等。此外，若非商品本身质量问题，大多数海外电商直运内地订单因退换货产生的运费、关税等进口税费需用户自行承担。若您在退换货时，可以登陆海外电商网站了解相关政策或咨询blinghour协助您了解。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		<b style=\"padding: 0px; margin: 0px;\">如果用户向海外电商网站申请退款或其他事项，须通过blinghour代下单时的支付账户收取退款的，用户应通过邮件向我们的客服邮箱service@blinghour.com提交退款申请。退款申请应包括委托订单号、退款金额、海外电商退款状态及预计到账时间，并附上海外电商网站同意退款的相关凭证。</b>blinghour将在收到海外电商网站返还的款项后3个工作日内，扣除第三方支付平台手续费后原路转付给用户。</p>\r\n	<h3 class=\"fs15\" microsoft=\"\" style=\"padding: 30px 0px 0px; margin: 0px 0px 8px; font-size: 15px; border-top: 1px solid rgb(224, 224, 224); position: relative; color: rgb(0, 0, 0); font-family: \">\r\n		7、进口税费缴纳及海关相关规定</h3>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		依法报关及纳税是商品收货人的法定义务。根据不同海外电商的销售政策和货运安排，进口环节应缴纳税费的支付时间和比例有所不同。blinghour已在商品详情页面对相关税费事宜做出基本介绍。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		blinghour不承担代缴进口环节税费的义务，也无法对中国海关是否征税及征税的金额及种类做出任何保证或承诺。blinghour不参与报关，也无法预知报关结果。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		中国海关的相关法律法规规章政策，以中国海关的官方网站的内容为主。用户可随时登录中国海关的官方网站（http://www.customs.gov.cn/），查阅最新内容。</p>\r\n	<h3 class=\"fs15\" microsoft=\"\" style=\"padding: 30px 0px 0px; margin: 0px 0px 8px; font-size: 15px; border-top: 1px solid rgb(224, 224, 224); position: relative; color: rgb(0, 0, 0); font-family: \">\r\n		8、使用法律及争议解决</h3>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		本声明的订立、执行及争议解决均应适用中华人民共和国法律。与本声明有关的或因本声明引起的任何争议，blinghour及用户应尽量通过友好协商解决；协商不成的，任何一方均有权向blinghour公司住所地人民法院提起诉讼。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		blinghour发出的任何协议、通知、规则构成本声明的一部分，并视为于发送或在blinghour网站公布之日送达用户并生效。如用户在协议、通知、规则发送或公布后继续使用代下单服务的，视为用户同意该协议、通知、规则的内容并接受其约束。如用户因任何原因没有阅读相关协议、通知、规则的，由用户自行承担不利后果，blinghour不承担由此产生的任何责任。</p>\r\n	<p font-size:=\"\" microsoft=\"\" style=\"padding: 0px; margin: 0px 0px 20px; line-height: 25px; color: rgb(0, 0, 0); font-family: \">\r\n		本声明中的任何条款无效的，不影响本声明的其余条款的效力。 blinghour未行使本声明的任何权利，不构成对该权利之放弃。</p>\r\n	<h3 class=\"fs15\" microsoft=\"\" style=\"padding: 30px 0px 0px; margin: 0px 0px 50px; font-size: 15px; font-weight: 500; border-top: 1px solid rgb(224, 224, 224); position: relative; color: rgb(0, 0, 0); font-family: \">\r\n		本声明最终解释权归blinghour所有。</h3>\r\n	<figcaption></figcaption> </figure></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://logistics.localhost//data/upload/201807/20180720173835693624.jpg\" style=\"height:38px; width:60px\" /></p>\r\n',1,0,0,1,'cn'),(6,'注册协议','<h4 style=\"margin: 5px 0px; font-size: 14px; color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	一、总则</h4>\r\n<p>\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">1.1 保宝网的所有权和运营权归深圳市永兴元科技有限公司所有。&nbsp;</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">1.2 用户在注册之前，应当仔细阅读本协议，并同意遵守本协议后方可成为注册用户。一旦注册成功，则用户与保宝网之间自动形成协议关系，用户应当受本协议的约束。用户在使用特殊的服务或产品时，应当同意接受相关协议后方能使用。&nbsp;</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">1.3 本协议则可由保宝网随时更新，用户应当及时关注并同意本站不承担通知义务。本站的通知、公告、声明或其它类似内容是本协议的一部分。</span></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	&nbsp;</p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	&nbsp;</p>\r\n<h4 style=\"margin: 5px 0px; font-size: 14px; color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	二、服务内容</h4>\r\n<p>\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">2.1 保宝网的具体内容由本站根据实际情况提供。&nbsp;</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">2.2 本站仅提供相关的网络服务，除此之外与相关网络服务有关的设备(如个人电脑、手机、及其他与接入互联网或移动网有关的装置)及所需的费用(如为接入互联网而支付的电话费及上网费、为使用移动网而支付的手机费)均应由用户自行负担。</span></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	&nbsp;</p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	&nbsp;</p>\r\n<h4 style=\"margin: 5px 0px; font-size: 14px; color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	三、用户帐号</h4>\r\n<p>\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">3.1 经本站注册系统完成注册程序并通过身份认证的用户即成为正式用户，可以获得本站规定用户所应享有的一切权限；未经认证仅享有本站规定的部分会员权限。保宝网有权对会员的权限设计进行变更。&nbsp;</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">3.2 用户只能按照注册要求使用真实姓名，及身份证号注册。用户有义务保证密码和帐号的安全，用户利用该密码和帐号所进行的一切活动引起的任何损失或损害，由用户自行承担全部责任，本站不承担任何责任。如用户发现帐号遭到未授权的使用或发生其他任何安全问题，应立即修改帐号密码并妥善保管，如有必要，请通知本站。因黑客行为或用户的保管疏忽导致帐号非法使用，本站不承担任何责任。</span></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	&nbsp;</p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	&nbsp;</p>\r\n<h4 style=\"margin: 5px 0px; font-size: 14px; color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	四、使用规则</h4>\r\n<p>\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">4.1 遵守中华人民共和国相关法律法规，包括但不限于《中华人民共和国计算机信息系统安全保护条例》、《计算机软件保护条例》、《最高人民法院关于审理涉及计算机网络著作权纠纷案件适用法律若干问题的解释(法释[2004]1号)》、《全国人大常委会关于维护互联网安全的决定》、《互联网电子公告服务管理规定》、《互联网新闻信息服务管理规定》、《互联网著作权行政保护办法》和《信息网络传播权保护条例》等有关计算机互联网规定和知识产权的法律和法规、实施办法。&nbsp;</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">4.2 用户对其自行发表、上传或传送的内容负全部责任，所有用户不得在本站任何页面发布、转载、传送含有下列内容之一的信息，否则本站有权自行处理并不通知用户：</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"margin-left: 20px; display: block; color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">(1)违反宪法确定的基本原则的；&nbsp;<br />\r\n	(2)危害国家安全，泄漏国家机密，颠覆国家政权，破坏国家统一的；&nbsp;<br />\r\n	(3)损害国家荣誉和利益的；&nbsp;<br />\r\n	(4)煽动民族仇恨、民族歧视，破坏民族团结的；&nbsp;<br />\r\n	(5)破坏国家宗教政策，宣扬邪教和封建迷信的；&nbsp;<br />\r\n	(6)散布谣言，扰乱社会秩序，破坏社会稳定的；<br />\r\n	(7)散布淫秽、色情、赌博、暴力、恐怖或者教唆犯罪的；&nbsp;<br />\r\n	(8)侮辱或者诽谤他人，侵害他人合法权益的；&nbsp;<br />\r\n	(9)煽动非法集会、结社、游行、示威、聚众扰乱社会秩序的；&nbsp;<br />\r\n	(10)以非法民间组织名义活动的；<br />\r\n	(11)含有法律、行政法规禁止的其他内容的。</span><span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">4.3 用户承诺对其发表或者上传于本站的所有信息(即属于《中华人民共和国著作权法》规定的作品，包括但不限于文字、图片、音乐、电影、表演和录音录像制品和电脑程序等)均享有完整的知识产权，或者已经得到相关权利人的合法授权；如用户违反本条规定造成本站被第三人索赔的，用户应全额补偿本站一切费用(包括但不限于各种赔偿费、诉讼代理费及为此支出的其它合理费用)；&nbsp;</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">4.4 当第三方认为用户发表或者上传于本站的信息侵犯其权利，并根据《信息网络传播权保护条例》或者相关法律规定向本站发送权利通知书时，用户同意本站可以自行判断决定删除涉嫌侵权信息，除非用户提交书面证据材料排除侵权的可能性，本站将不会自动恢复上述删除的信息；</span><span style=\"margin-left: 20px; display: block; color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">(1)不得为任何非法目的而使用网络服务系统；&nbsp;<br />\r\n	(2)遵守所有与网络服务有关的网络协议、规定和程序； (3)不得利用本站进行任何可能对互联网的正常运转造成不利影响的行为；&nbsp;<br />\r\n	(4)不得利用本站进行任何不利于本站的行为。</span><span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">4.5 如用户在使用网络服务时违反上述任何规定，本站有权要求用户改正或直接采取一切必要的措施(包括但不限于删除用户张贴的内容、暂停或终止用户使用网络服务的权利)以减轻用户不当行为而造成的影响。</span></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	&nbsp;</p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	&nbsp;</p>\r\n<h4 style=\"margin: 5px 0px; font-size: 14px; color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	五、隐私保护</h4>\r\n<p>\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">5.1 本站不对外公开或向第三方提供单个用户的注册资料及用户在使用网络服务时存储在本站的非公开内容，但下列情况除外：</span><span style=\"margin-left: 20px; display: block; color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">(1)事先获得用户的明确授权；&nbsp;<br />\r\n	(2)根据有关的法律法规要求；<br />\r\n	(3)按照相关政府主管部门的要求；<br />\r\n	(4)为维护社会公众的利益。</span><span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">5.2 本站可能会与第三方合作向用户提供相关的网络服务，在此情况下，如该第三方同意承担与本站同等的保护用户隐私的责任，则本站有权将用户的注册资料等提供给该第三方。</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">5.3 在不透露单个用户隐私资料的前提下，本站有权对整个用户数据库进行分析并对用户数据库进行商业上的利用。</span></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	&nbsp;</p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	&nbsp;</p>\r\n<h4 style=\"margin: 5px 0px; font-size: 14px; color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	六、版权声明</h4>\r\n<p>\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">6.1 本站的文字、图片、音频、视频等版权均归永兴元科技有限公司享有或与作者共同享有，未经本站许可，不得任意转载。&nbsp;</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">6.2 本站特有的标识、版面设计、编排方式等版权均属永兴元科技有限公司享有，未经本站许可，不得任意复制或转载。&nbsp;</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">6.3 使用本站的任何内容均应注明&ldquo;来源于保宝网&rdquo;及署上作者姓名，按法律规定需要支付稿酬的，应当通知本站及作者及支付稿酬，并独立承担一切法律责任。</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">6.4 本站享有所有作品用于其它用途的优先权，包括但不限于网站、电子杂志、平面出版等，但在使用前会通知作者，并按同行业的标准支付稿酬。</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">6.5 本站所有内容仅代表作者自己的立场和观点，与本站无关，由作者本人承担一切法律责任。&nbsp;</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">6.6 恶意转载本站内容的，本站保留将其诉诸法律的权利。</span></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	&nbsp;</p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	&nbsp;</p>\r\n<h4 style=\"margin: 5px 0px; font-size: 14px; color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">\r\n	七、责任声明</h4>\r\n<p>\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">7.1 用户明确同意其使用本站网络服务所存在的风险及一切后果将完全由用户本人承担，保宝网对此不承担任何责任。&nbsp;</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">7.2 本站无法保证网络服务一定能满足用户的要求，也不保证网络服务的及时性、安全性、准确性。&nbsp;</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">7.3 本站不保证为方便用户而设置的外部链接的准确性和完整性，同时，对于该等外部链接指向的不由本站实际控制的任何网页上的内容，本站不承担任何责任。</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">7.4 对于因不可抗力或本站不能控制的原因造成的网络服务中断或其它缺陷，本站不承担任何责任，但将尽力减少因此而给用户造成的损失和影响。</span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\" />\r\n	<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">7.5 对于站向用户提供的下列产品或者服务的质量缺陷本身及其引发的任何损失，本站无需承担任何责任：</span><span style=\"margin-left: 20px; display: block; color: rgb(51, 51, 51); font-family: &quot;Microsoft YaHei&quot;;\">(1)本站向用户免费提供的各项网络服务；&nbsp;</span></p>\r\n',2,0,0,1,'cn'),(7,'身份证上传协议','<p>\r\n	身份证上传协议</p>\r\n',3,0,0,1,'cn');
