 color: rgb(133, 141, 179); font-family: &quot;Microsoft Yahei&quot;, PingFangSC-Regular, Helvetica, arial, sans-serif; font-size: 14px; letter-spacing: 0.8px;\">\r\n	&ldquo;构建自身&rdquo;建设城乡服务体系。我市瞄准城区网络，通过设立网点、上门服务、智能快件箱，让自助服务深入校园、社区、楼宇、机关；创新覆盖乡镇，引导快递企业&ldquo;抱团下乡&rdquo;，在四区范围内设立乡镇网点，并借助&ldquo;农村淘宝&rdquo;&ldquo;赶街网&rdquo;服务乡镇网点，实现&ldquo;网货下乡&rdquo;和&ldquo;农产品进城&rdquo;双向流通，目前快递服务已覆盖全市108个乡镇。</p>\r\n<p style=\"margin: 0px 0px 28px; padding: 0px; box-sizing: border-box; color: rgb(133, 141, 179); font-family: &quot;Microsoft Yahei&quot;, PingFangSC-Regular, Helvetica, arial, sans-serif; font-size: 14px; letter-spacing: 0.8px;\">\r\n	&ldquo;强化自身&rdquo;提升快递基础实力。投资约4.6亿元建设三个快递物流产业园区，同时租赁场地设立分拣中心20余个，均配备半自动分拣设备，拥有各类运输、投递车辆246辆，形成运输投递网路396条；引导国内主要品牌快递企业在内江成立法人企业或分支机构，引进邮政、快递企业签约入驻产业园区。目前，苏宁云商、邮政内江市分公司、邮政速递物流内江分公司等寄递企业已签约入驻，圆通快递川南分拨中心、顺丰快递川南分拨中心正在洽谈中。</p>\r\n<p style=\"margin: 0px 0px 28px; padding: 0px; box-sizing: border-box; color: rgb(133, 141, 179); font-family: &quot;Microsoft Yahei&quot;, PingFangSC-Regular, Helvetica, arial, sans-serif; font-size: 14px; letter-spacing: 0.8px;\">\r\n	&ldquo;携手共进&rdquo;开拓现代经济服务市场。我市支持快递企业主动融入全市电子商务产业发展，与我市电商企业在仓储、运输、投递等各个环节基本实现无缝衔接；引导快递进驻制造型企业，与&ldquo;黄老五&rdquo;&ldquo;赵老师&rdquo;等农副食品加工企业建立良好合作关系；指导快递企业深入农村开发&ldquo;快递+特色农产品&rdquo;合作项目，并延伸出产品包装等配套服务。目前，快递已助销&ldquo;资中血橙&rdquo;&ldquo;不知火&rdquo;&ldquo;莲子&rdquo;等农特产品，仅2017年，快递业就带动本地产品网络销售过百万件，销售额超亿元；拉动网络购物3000余万件，带动消费100多亿元。（记者 徐艳梅）</p>\r\n',1,-1,1538542588,1,'cn'),(7,'市委七届七次全会明确指出要大力发展现代物流业','<p style=\"margin: 0px 0px 28px; padding: 0px; box-sizing: border-box; color: rgb(133, 141, 179); font-family: &quot;Microsoft Yahei&quot;, PingFangSC-Regular, Helvetica, arial, sans-serif; font-size: 14px; letter-spacing: 0.8px;\">\r\n	市委市政府高度重视物流产业发展，市委七届五次全会审议通过了《关于加快推进现代物流业创新发展的决定》，市委七届七次全会又明确指出要大力发展现代物流业。日前，记者从市邮政管理部门获悉，我市从建设城乡服务体系、提升快递基础实力、开拓现代经济服务市场三个方面着手，着力提升我市现代物流产业水平。</p>\r\n<p style=\"margin: 0px 0px 28px; padding: 0px; box-sizing: border-box; color: rgb(133, 141, 179); font-family: &quot;Microsoft Yahei&quot;, PingFangSC-Regular, Helvetica, arial, sans-serif; font-size: 14px; letter-spacing: 0.8px;\">\r\n	&ldquo;构建自身&rdquo;建设城乡服务体系。我市瞄准城区网络，通过设立网点、上门服务、智能快件箱，让自助服务深入校园、社区、楼宇、机关；创新覆盖乡镇，引导快递企业&ldquo;抱团下乡&rdquo;，在四区范围内设立乡镇网点，并借助&ldquo;农村淘宝&rdquo;&ldquo;赶街网&rdquo;服务乡镇网点，实现&ldquo;网货下乡&rdquo;和&ldquo;农产品进城&rdquo;双向流通，目前快递服务已覆盖全市108个乡镇。</p>\r\n<p style=\"margin: 0px 0px 28px; padding: 0px; box-sizing: border-box; color: rgb(133, 141, 179); font-family: &quot;Microsoft Yahei&quot;, PingFangSC-Regular, Helvetica, arial, sans-serif; font-size: 14px; letter-spacing: 0.8px;\">\r\n	&ldquo;强化自身&rdquo;提升快递基础实力。投资约4.6亿元建设三个快递物流产业园区，同时租赁场地设立分拣中心20余个，均配备半自动分拣设备，拥有各类运输、投递车辆246辆，形成运输投递网路396条；引导国内主要品牌快递企业在内江成立法人企业或分支机构，引进邮政、快递企业签约入驻产业园区。目前，苏宁云商、邮政内江市分公司、邮政速递物流内江分公司等寄递企业已签约入驻，圆通快递川南分拨中心、顺丰快递川南分拨中心正在洽谈中。</p>\r\n<p style=\"margin: 0px 0px 28px; padding: 0px; box-sizing: border-box; color: rgb(133, 141, 179); font-family: &quot;Microsoft Yahei&quot;, PingFangSC-Regular, Helvetica, arial, sans-serif; font-size: 14px; letter-spacing: 0.8px;\">\r\n	&ldquo;携手共进&rdquo;开拓现代经济服务市场。我市支持快递企业主动融入全市电子商务产业发展，与我市电商企业在仓储、运输、投递等各个环节基本实现无缝衔接；引导快递进驻制造型企业，与&ldquo;黄老五&rdquo;&ldquo;赵老师&rdquo;等农副食品加工企业建立良好合作关系；指导快递企业深入农村开发&ldquo;快递+特色农产品&rdquo;合作项目，并延伸出产品包装等配套服务。目前，快递已助销&ldquo;资中血橙&rdquo;&ldquo;不知火&rdquo;&ldquo;莲子&rdquo;等农特产品，仅2017年，快递业就带动本地产品网络销售过百万件，销售额超亿元；拉动网络购物3000余万件，带动消费100多亿元。（记者 徐艳梅）</p>\r\n',1,-1,1538542623,1,'cn');
