--
-- Table structure for table `cc_order`
--

DROP TABLE IF EXISTS `cc_order`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `cc_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `orderNo` varchar(30) NOT NULL COMMENT '面单号',
  `waybillCode` varchar(30) NOT NULL COMMENT '快递公司运单号(',
  `associatedNo` varchar(30) NOT NULL COMMENT '关联单号',
  `agentId` int(6) NOT NULL COMMENT '代理点id',
  `frName` varchar(50) NOT NULL COMMENT '发件人',
  `frPhone` varchar(50) NOT NULL COMMENT '发件人电话',
  `frCompany` varchar(100) NOT NULL COMMENT '发件人公司',
  `frProvince` varchar(20) NOT NULL COMMENT '发件人省',
  `frCity` varchar(40) NOT NULL COMMENT '发件人市',
  `frCounty` varchar(30) NOT NULL COMMENT '发件人县，区',
  `frAddress` varchar(200) NOT NULL COMMENT '发件人地址',
  `frCountry` varchar(20) NOT NULL DEFAULT 'CN' COMMENT '发件人国家',
  `frZipCode` varchar(10) NOT NULL COMMENT '发件人邮编',
  `toAddress` varchar(100) NOT NULL COMMENT '收件人详细地址',
  `toName` varchar(50) NOT NULL COMMENT '收件人',
  `toPhone` varchar(50) NOT NULL COMMENT '收件人电话',
  `toCompany` varchar(200) NOT NULL COMMENT '收件人公司',
  `toDoorNo` varchar(50) NOT NULL COMMENT '收件人门牌号',
  `toStreet` varchar(50) NOT NULL COMMENT '收件人街道',
  `toCounty` varchar(40) NOT NULL COMMENT '区 县',
  `toCity` varchar(50) NOT NULL COMMENT '收件人城市',
  `toProvince` varchar(30) NOT NULL COMMENT '收件人省',
  `toCountry` varchar(200) NOT NULL COMMENT '收件人国家',
  `toZipCode` varchar(20) NOT NULL COMMENT '收件人邮政编码',
  `toTax` varchar(30) NOT NULL COMMENT '税号',
  `toBranch` varchar(60) NOT NULL COMMENT '分行',
  `IDNumber` varchar(20) NOT NULL COMMENT '收件人身份证',
  `weight` float NOT NULL COMMENT '包裹重量单位KG',
  `checkWeight` float NOT NULL COMMENT '核重',
  `volume` float NOT NULL COMMENT '体积',
  `length` float NOT NULL DEFAULT '0' COMMENT '长单位cm',
  `width` float NOT NULL DEFAULT '0' COMMENT '宽单位cm',
  `height` float NOT NULL DEFAULT '0' COMMENT '高单位cm',
  `tax` float NOT NULL COMMENT '税费',
  `insurance` float NOT NULL COMMENT '保险费',
  `print` int(2) NOT NULL DEFAULT '0' COMMENT '是否打印',
  `batchId` int(8) NOT NULL COMMENT '批次号',
  `createTime` int(10) NOT NULL,
  `updateTime` int(10) NOT NULL,
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '0无,-1问题件',
  `pickIn` int(1) NOT NULL DEFAULT '0' COMMENT '是否取件',
  `instore` int(1) NOT NULL DEFAULT '0' COMMENT '是否进入仓库',
  `outstore` int(1) NOT NULL DEFAULT '0' COMMENT '是否出库',
  `userId` int(11) NOT NULL COMMENT '提交面单的用户ID',
  `editTime` int(10) NOT NULL,
  `editors` varchar(60) NOT NULL COMMENT '编辑者',
  `lineId` int(11) NOT NULL DEFAULT '0',
  `pickInTime` int(10) NOT NULL DEFAULT '0',
  `instoreTime` int(10) NOT NULL DEFAULT '0',
  `outTime` int(10) NOT NULL DEFAULT '0',
  `pickerId` int(11) DEFAULT NULL,
  `warehouserId` int(6) NOT NULL COMMENT '仓库账号',
  `remarks` varchar(30) DEFAULT NULL,
  `accept` int(2) NOT NULL DEFAULT '0' COMMENT '司机是否从系统接单',
  `acceptTime` int(10) NOT NULL COMMENT '司机从系统接单时间',
  `recept` int(2) DEFAULT '0' COMMENT '司机是否收到',
  `receptTime` int(10) NOT NULL COMMENT '快递公司司机上门收单时间',
  `pay` int(2) NOT NULL COMMENT '支付状态 1 正在支付 2 支付完成',
  `payTime` int(10) NOT NULL COMMENT '支付时间',
  `origin` varchar(20) NOT NULL COMMENT '订单来源',
  `packageId` varchar(40) NOT NULL COMMENT '京东包裹号',
  `createType` int(11) NOT NULL DEFAULT '1' COMMENT '1 在线下单 2司机下单 3 仓库称重 4批量下单 5api创建',
  `hold` int(2) NOT NULL COMMENT '订单是否截停',
  `holdTime` int(10) NOT NULL COMMENT '截停时间',
  `cancel` int(2) NOT NULL COMMENT '是否取消',
  `cancelTime` int(10) NOT NULL COMMENT '取消时间',
  `auditTime` int(10) NOT NULL COMMENT '订单审核时间',
  `merchantId` int(4) NOT NULL COMMENT '商户id',
  `affirm` int(2) NOT NULL COMMENT '是否核实',
  `sign` int(2) NOT NULL COMMENT '1 签收 0 未签收',
  `editor` int(6) NOT NULL COMMENT '正在编辑',
  PRIMARY KEY (`id`),
  UNIQUE KEY `orderNo` (`orderNo`),
  KEY `isPickIn` (`pickIn`),
  KEY `isInStore` (`instore`),
  KEY `isOut` (`outstore`)
) ENGINE=InnoDB AUTO_INCREMENT=1381 DEFAULT CHARSET=utf8 COMMENT='面单管理';
/*!40101 SET character_set_client = @saved_cs_client */;

