DROP TABLE IF EXISTS `cc_product`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `cc_product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `updateTime` int(10) NOT NULL COMMENT '更新时间',
  `name` varchar(255) NOT NULL COMMENT '产品名称',
  `nameEn` varchar(255) NOT NULL COMMENT '英文名称',
  `image` varchar(100) NOT NULL,
  `brandId` int(11) NOT NULL,
  `categoryId` int(11) NOT NULL,
  `path` varchar(100) NOT NULL COMMENT '产品分类路径',
  `SKU` varchar(30) NOT NULL,
  `URL` varchar(120) NOT NULL,
  `weight` decimal(10,2) NOT NULL,
  `barCode` varchar(100) NOT NULL COMMENT '条形码',
  `spec` varchar(20) NOT NULL COMMENT '单位',
  `unit` int(11) NOT NULL COMMENT '规格单位',
  `price` decimal(16,2) NOT NULL,
  `declarePrice` decimal(16,2) NOT NULL COMMENT '报关价格',
  `declareCode` varchar(30) NOT NULL,
  `crossTaxId` int(4) NOT NULL COMMENT '跨境税ID',
  `parcelTaxId` int(6) NOT NULL COMMENT '行邮税ID',
  `status` tinyint(2) NOT NULL COMMENT '状态',
  `createTime` int(11) NOT NULL,
  `isDeclare` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否是申报产品，1:是',
  `userId` int(11) NOT NULL DEFAULT '0' COMMENT '如果是申报产品则记录申报用户',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=108 DEFAULT CHARSET=utf8;
