  `isSuper` tinyint(4) NOT NULL DEFAULT '0',
  `action` text,
  `info` text,
  `infoClass` text,
  `relation` text,
  `staff` int(2) NOT NULL COMMENT '员工',
  `role` varchar(10) NOT NULL,
  `driver` int(2) NOT NULL,
  `agent` int(2) NOT NULL,
  `warehouse` int(2) NOT NULL,
  `financial` int(2) NOT NULL,
  `branch` int(2) NOT NULL COMMENT '分公司角色',
  `member` int(2) NOT NULL COMMENT '会员角色',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COMMENT='角色相关';
